class DisjointSet:
    def __init__(self, n):
        self.n = n
        self.rank = [0]*n
        self.parent = list(range(n))

    def union(self, u, v):
        ru, rv = self.find(u), self.find(v)
        if ru == rv:
            return False

        if self.rank[ru] < self.rank[rv]:
            self.parent[ru] = rv
        elif self.rank[ru] > self.rank[rv]:
            self.parent[rv] = ru
        else:
            self.parent[rv] = ru
            self.rank[ru] += 1

        return True

    def find(self, u):
        if u!= self.parent[u]:
            self.parent[u] = self.find(self.parent[u])

        return self.parent[u]

    def get(self):
        return self.parent


