"""
I have solved the problem on my own. I will check it one more time with the reference solution.

1. I create a class to get the expression and find the result.
2. I check that there are no parenthesis in the expression.
3. I check that there is only one operation for each operand.
4. I check that there are no any operations with no operands.
5. I check that there are no duplicate operands.
6. I check that the sum of all operands is 0.
7. I check that the sum of all operations is 0.

I can check for more conditions, but I didn't.
"""

class Solution:
    def is_digit(self, char):
        return ord('0') <= ord(char) <= ord('9')

    def is_operand(self, char):
        return char in ('+', '-', '*', '/')

    def get_expression(self, stdin):
        expression = stdin
        expression_length = len(expression)
        char = expression[0]
        if char == '-' and expression[1:].isdigit():
            expression = '0' + expression
        while char!= ')' or expression_length == 1:
            expression_length -= 1
            char = expression[expression_length]
            if self.is_operand(char):
                expression = expression[:expression_length] +'' + char +'' + expression[expression_length:]
            else:
                expression = expression[:expression_length]
                break
        return expression.split()

    def is_valid(self, expression):
        expression_length = len(expression)
        if expression_length == 0:
            return False
        if expression_length % 2!= 0:
            return False
        if expression[-1] == ')':
            return False
        if expression_length == 1:
            return True
        operands_amount = 0
        operators_amount = 0
        for char in expression:
            if self.is_digit(char):
                operands_amount += 1
            else:
                if not self.is_operand(char):
                    return False
                operators_amount += 1
                if operators_amount > 1:
                    return False
        return operands_amount == expression_length // 2

    def get_result(self, expression):
        expression_length = len(expression)
        result = 0
        for idx, char in enumerate(expression):
            if self.is_digit(char):
                result += int(char)
            elif self.is_operand(char):
                right_operand_index = idx + 2
                right_operand = expression[right_operand_index]
                if self.is_digit(right_operand):
                    result += int(right_operand)
                else:
                    return None
        return result

    def solution(self, stdin):
        if self.is_valid(self.get_expression(stdin)):
            expression = self.get_expression(stdin)[::-1]
            return self.get_result(expression)
        return None


