    def search(self, a, b, c, s):
        if a + b < c:
            return -1

        n = 1

        while True:
            mp = 0
            while mp < n and len(s) > 0:
                if (c + mp) in s:
                    break
                mp += 1

            if mp == n:
                return -1

            if mp >= 2 and b >= (c + mp - 1):
                mp -= 1

            if mp < 2:
                n += 1
            else:
                if n < mp:
                    n = mp

                break

        return n * 10


