import sys
import queue

class Graph:
    def __init__(self, n, edges, max_w):
        self.graph = {}
        for node in range(n):
            self.graph[node] = []
        for edge in edges:
            u, v, w = edge
            if u in self.graph:
                self.graph[u].append((v, w))
            else:
                self.graph[u] = [(v, w)]
        self.max_w = max_w
        self.queue = queue.Queue()
        self.parent = dict()
        self.max_depth = -1

    def bfs(self, start_node):
        self.parent[start_node] = None
        self.queue.put(start_node)
        while not self.queue.empty():
            u = self.queue.get()
            for v, w in self.graph[u]:
                if v not in self.parent:
                    self.parent[v] = u
                    self.queue.put(v)
                if w <= self.max_w:
                    self.max_depth = max(self.max_depth, len(self.parent))

    def dfs(self, u, depth):
        self.max_depth = max(self.max_depth, depth)
        for v, w in self.graph[u]:
            if v not in self.parent:
                self.parent[v] = u
                self.dfs(v, depth + 1)

    def solution(self):
        for u, _ in self.graph.items():
            self.bfs(u)
            self.dfs(u, 0)
        return [self.max_depth] + [len(set(self.parent.values()))] * (self.max_depth + 1)

